import React, { useState } from 'react';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import ListItemAvatar from '@material-ui/core/ListItemAvatar';
import Divider from '@material-ui/core/Divider';
import Avatar from '@material-ui/core/Avatar';
import Typography from '@material-ui/core/Typography';
import './User.css';

function User({ user }) {
    const [userInfo, setUserInfo] = useState({});
    const handleClick = (user) => {
        setUserInfo(user);
        console.log(user);
    }
    return (
        <div className="user">
            <List className="users__list">
                <ListItem button className="users__listitem" alignItems="flex-start" onClick={() => handleClick(user)}>
                    <ListItemAvatar>
                        <Avatar alt={user.real_name} src="/static/images/avatar/1.jpg" />
                    </ListItemAvatar>
                    <ListItemText
                        primary={user.real_name}
                        secondary={
                            <Typography
                                component="span"
                                variant="body2"
                                className="users__name"
                                color="textPrimary"
                            >
                                {user.tz}
                            </Typography>
                        }
                    />
                </ListItem>
                <Divider variant="inset" component="li" />
            </List>
        </div>
    )
}

export default User;
